import React from "react";



function Contact() {
  return (
    <div>


      <h1 className="text-center">Contact Me</h1>
      <br></br>
      <h2 className="text-center">
        Look at all these ways to contact me!
      </h2>
      <br></br>
      <a className="text-center" href="tel:1-408-555-5555" target="_blank" rel="noopener noreferrer"><h3>Phone number - 512-000-0000</h3></a> 
      <br></br>
      <a className="text-center" href="mailto:playboy@playboy.com" target="_blank" rel="noopener noreferrer"><h3>Email</h3></a> 
      <br></br>
      <a className="text-center" href="https://github.com/MigsGithub" target="_blank" rel="noopener noreferrer"><h3>GitHub</h3></a> 
      <br></br>
      <a className="text-center" href="https://www.linkedin.com/in/migatx/" target="_blank" rel="noopener noreferrer"><h3>LinkedIn</h3></a>
      <br></br>
      <a className="text-center" href="https://www.icloud.com/pages/0-2SDue9x_Jz53f3zr5cI2TRw#Resume_for_school" target="_blank" rel="noopener noreferrer"><h3>Resume</h3></a>
      <br></br>



    </div>
  );
};

export default Contact;
